import React from 'react';

class Sidebar extends React.Component {
    open() {
        document.getElementById("mySidebar").style.display = "block";
    }

    close() {
        document.getElementById("mySidebar").style.display = "none";
    }

    render() {
        return (
            <div>
                <div className="w3-sidebar w3-bar-block w3-collapse" style="width:200px;right:0" id="mySidebar">
                    <button className="w3-bar-item w3-button w3-hide-large" onClick={this.close}>Close</button> 
                    <a href="#" className="w3-bar-item w3-button">Link 1</a> 
                    <a href="#" className="w3-bar-item w3-button">Link 2</a> 
                    <a href="#" className="w3-bar-item w3-button">Link 3</a>
                </div>

                <div className="w3-main" style="margin-right:200px">
                    <div className="w3-teal">
                        <button className="w3-button w3-teal w3-xlarge w3-right w3-hide-large" onClick={this.open}>&#9776;</button>
                        <div className="w3-container">
                            <h2>My Page</h2>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Sidebar;
